import styled from "styled-components";

export const Title = styled.h3`
  color: #fff;
  font-size: 1.2rem;
  letter-spacing: 2px;
  font-weight: normal;
  text-align: center;
`;

export const SkillContainer = styled.div`
  max-width: 1000px;
  margin: 0 auto;
  align-items: center;
`;
